export const PLIST_ASCII = Buffer.from(`<?xml version="1.0" encoding="UTF-8"?>
<!DOCTYPE plist PUBLIC "-//Apple//DTD PLIST 1.0//EN" "http://www.apple.com/DTDs/PropertyList-1.0.dtd">
<plist version="1.0">
  <dict>
    <key>key</key>
    <string>value</string>
  </dict>
</plist>`);

// Equivalent to PLIST_ASCII but encoded in binary form with:
//   `plutil -convert binary1 ascii.plist -o - | base64`
export const BPLIST00_BASE64 = Buffer.from(
  'YnBsaXN0MDDRAQJTa2V5VXZhbHVlCAsPAAAAAAAAAQEAAAAAAAAAAwAAAAAAAAAAAAAAAAAAABU',
  'base64'
);

// Equivalent to BPLIST00_BASE64 but with magic `bplist01`.
export const BPLIST01_BASE64 = Buffer.from(
  'YnBsaXN0MDHQCAAAAAAAAAEBAAAAAAAAAAEAAAAAAAAAAAAAAAAAAAAJCg',
  'base64'
);

